import { Component } from '@angular/core';

@Component({
  selector: 'app-presentation',
  templateUrl: './presentation.component.html',
  styleUrls: ['./presentation.component.css']
})
export class PresentationComponent {

}
<div class="presentation" id="prev">
  <div class="imgPres">
    <img src="assets/me.png" alt="moi">
  </div>
  <div class="textPres">
    <p>Je m’appelle Valentin Moizan et je suis en 3 ème année du cycle informatique et réseau à
      l’ISEN de Brest. Dès le collège, j’ai commencé à développer ma passion pour l’informatique
      en passant par les jeux vidéo et en montant des projets personnels autour de ceux ci. Mon
      intérêt dans ce domaine s’est focalisé sur le développement logiciel et notamment la cyber
      sécurité.</p>
  </div>
</div>
